import type {
  PaletteColorOptions,
  PaletteOptions,
} from "@material-ui/core/styles/createPalette";

const primayyColor: PaletteColorOptions = {
  main: "#5F3EA7",
};

const secondaryColor: PaletteColorOptions = {
  main: "#009FB4",
};
const white: PaletteColorOptions = {
  main: "#ffffff",
};

export const Palette: PaletteOptions = {
  primary: primayyColor,
  secondary: secondaryColor,
};
